import React, { Fragment } from "react";
import Chef from "../../../interfaces/Chef";
import "./HomePage.scss";
import ChefCard from "../../layout/card/ChefCard";

interface ChefProps {
  chefs: Chef[];
}

const ChefItem: React.FC<Chef> = ({
  key,
  chefName,
  chefImage,
  chefDescription,
  restaurantName,
  restaurantImage,
}: Chef) => {
  return (
    <ChefCard key={key} title={chefName} detail={chefDescription} restaurantImg={restaurantImage} restaurantName={restaurantName} img={chefImage}></ChefCard>
  );
};

const Chefs: React.FC<ChefProps> = ({ chefs }: ChefProps) => {
  const yossiRestaurants:object[] = chefs.filter(chef=> chef.chefName === "Yossi Shitrit");
  return (
    <Fragment>
      {yossiRestaurants.map((chef) => {
          return (
            <ChefItem
              key={chef.key}
              chefName={chef.chefName}
              chefImage={chef.chefImage}
              chefDescription={chef.chefDescription}
              restaurantName={chef.restaurantName}
              restaurantImage={chef.restaurantImage}
            ></ChefItem>
          );
      })}
    </Fragment>
  );
};

export default Chefs;
